using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Security.Cryptography;
using System.IO;

namespace BreakOut_01.Elements
{
    public static class ExternelHelperClass
    {
        /*
        Various Data for Default Level and Level Editor
        Data are encoded in Base64.
        */

        #region Data

        private static string DefaultLevel = "";
        public static string DefaultLevelHash = "6a7eb5a2171960dd5a44ec4ac8ffdae3";

        private static string LevelEditor = "";
        public static string LevelEditorHash = "efdec31137de24e67b2415495630647c";

        //Image Library
        private static string mldll = "";
        public static string mldllHash = "d460e5315d8c4457f2b40ceb66581c5b";

        //ini class
        private static string eIni = "";
        public static string eIniHash = "375f837696c74ef7036d7c123ad563e8";

        //Data set for Images of Blocks for the Level Editor
        private static string BlocksData = "";
        public static string BlocksDataHash = "79674c13b08c2b80c3993822d96488c7";

        #endregion

        private static byte[] ConvertToByteArray(string data)
        {
            return Convert.FromBase64String(data);
        }


        public static byte[] GetDefaultLevel
            { get { return ConvertToByteArray(DefaultLevel); } }

        public static byte[] GetLevelEditor
        { get { return ConvertToByteArray(LevelEditor); } }

        public static byte[] Getmldll
        { get { return ConvertToByteArray(mldll); } }

        public static byte[] GeteIni
        { get { return ConvertToByteArray(eIni); } }

        public static byte[] GetBlocksData
        { get { return ConvertToByteArray(BlocksData); } }


        private static string MD5FromFile(string fileName)
        {
            using (MD5 md5 = MD5.Create())
            {
                using (FileStream stream = File.OpenRead(fileName))
                    return BitConverter.ToString(md5.ComputeHash(stream)).Replace("-", "").ToLower();
            }
        }


        public static void RestoreDefault()
        {
            string currentPath = Directory.GetCurrentDirectory();

            if (!File.Exists(Path.Combine(currentPath, "level_0.bin")))
                File.WriteAllBytes(Path.Combine(currentPath, "level_0.bin"), GetDefaultLevel);

            if (!File.Exists(Path.Combine(currentPath, "Breakout Level Editor.exe")))
                File.WriteAllBytes(Path.Combine(currentPath, "Breakout Level Editor.exe"), GetLevelEditor);

            if (!File.Exists(Path.Combine(currentPath, "eIni.dll")))
                File.WriteAllBytes(Path.Combine(currentPath, "eIni.dll"), GeteIni);

            if (!File.Exists(Path.Combine(currentPath, "mldll.dll")))
                File.WriteAllBytes(Path.Combine(currentPath, "mldll.dll"), Getmldll);

            if (!File.Exists(Path.Combine(currentPath, "data_0.bin")))
                File.WriteAllBytes(Path.Combine(currentPath, "data_0.bin"), GetBlocksData);
        }
    }
}
